import React from "react";
// import {Route, Switch, Link} from 'react-router-dom';
import './MemberView.css';

export default function MemberView(props){

    return(
        <div>
            <h1>MemberView</h1>
            {names = props.lastGroup.users.map((user) => <p> {user.name} </p>)}

        </div>
    )
}
